import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="counterContent">
          <div className="counterHeader">
          <h1 className="display-4 text-primary text-center">React Counter</h1>
          </div>
          <div className="counterBody">
          <h1 className="display-4">5</h1>
          <button>Add Count</button>
          <button>Lower Count</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
